import React from "react";
import "./Header.css";
import Tittle from './tittle/Tittle';

function Header() {
	return (
		<div>
			<div class="header ">

				<img src="./assets/bg-header.jpg" class="img-fluid img-bg " alt="" />
				<div class=" about text-white m-4">
				<h3 className="lema">Districarnes</h3>
					<h5><Tittle/></h5>
					<p>
					Tenemos el privilegio de cuidar nuestro producto desde su origen, obteniendo 
					una carne saludable de magnifico sabor.
					</p>
					br
					<h3 className="lema">Calidad y buen Servicio</h3>
				</div>
			</div>
		</div>
	);
}
export default Header;
